afes and Coffee Shops Page\r\n    Then should see Description Area Description: \"Welcome to Traum, where we specialize in providing high-quality coffee for cafes and coffee shops. We know that coffee is an essential part of your business, and we want to help you offer your customers the best possible coffee experience.Our coffee beans are sourced from around the world and carefully selected for their quality and unique flavor profiles. We roast our beans in small batches to ensure that each bag of coffee is fresh and flavorful. Our coffee experts are dedicated to crafting the perfect blends to meet your specific needs.We also offer support and resources to help you and your staff learn about coffee brewing techniques, equipment maintenance, and other important aspects of coffee service.We believe that coffee is more than just a drink; it's a way to connect with others, build relationships, and create memorable experiences.\" on Cafes and Coffee Shops Page\r\n    Then should see Are You Brewing Up Area Title: \"Are You Brewing Up A Coffee Business Or Looking To Expand?\" on Cafes and Coffee Shops Page\r\n    Then should see Are You Brewing Up Area Description: \"We understand what your cafe needs!At Traum Kaffee, we're here to support your coffee business, whether you are starting a new coffee business or you're expanding to new locations, upgrading your equipment, or adding to your team.  We offer a range of top-quality espresso machines, grinders, and accessories to help you serve the best coffee possible.Traum Kaffee is more than just a coffee supplier - we're part of your operations team. We offer customized service, equipment set-up, and training from our expert baristas to ensure your success.We care about your success and will work with you to create a customized solution that meets your cafe needs.\" on Cafes and Coffee Shops Page\r\n    Then should see Are You Brewing Up Area Image on Cafes and Coffee Shops Page\r\n    Then should see The Art Of Making Area Title: \"The Art Of Making The Perfect Coffee\" on Cafes and Coffee Shops Page\r\n    Then should see The Art Of Making Area Description: \"We train new businesses, existing customers, and those wishing to advance or refresh their barista skills. Whether you need a refresher, have new team members joining, or want to learn new skills, our training can be a game-changer.Visit our Training page, specially designed to help them master the art of coffee preparation.\" on Cafes and Coffee Shops Page\r\n    Then should see The Art Of Making Area Image on Cafes and Coffee Shops Page\r\n    Then should see The Art Of Making Area Training Button: \"TRAINING\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Title: \"Let's Grab a Coffee!\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Description: \"For more information on how to partner with us and to learn more about our wholesale coffee program,contact us now!\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Full Name: \"Full Name\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Email: \"Email\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Contact Number: \"Contact Number\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Business Name: \"Business Name\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Type of Business: \"Type of Business\" on Cafes and Coffee Shops Page\r\n    When click Lets Grab a Coffee Area Type of Busines on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Hotel\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Restaurant\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Cafe\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Office\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Events\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Other\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Tell us: \"Tell us a bit about your business... the more info the better!\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Send Button: \"SEND\" on Cafes and Coffee Shops Page\r\n    Then should see Stand Out Area Title: \"Stand Out In The Coffee Industry\" on Cafes and Coffee Shops Page\r\n    Then should see Stand Out Area Description: \"We understand that standing out in the coffee industry can be a challenge.With Traum, you can offer your customers a unique and unforgettable coffee experience. Let us show how we can help you stand out in the crowded coffee industry with our quality coffee and exceptional consultancy!\" on Cafes and Coffee Shops Page\r\n    Then should see Stand Out Area Image on Cafes and Coffee Shops Page\r\n\r\n  @TheArtOfMakingArea @Navigate\r\n  Scenario: From Barista Area Navigate Control\r\n    Given user on the Cafes and Coffee Shops Page\r\n    When click The Art Of Making Area Training Button on Cafes and Coffee Shops Page\r\n    Then should see the Training Page\r\n\r\n  @LetsGrabaCoffeeArea @Successfully\r\n  Scenario Outline: Lets Grab a Coffee Area Successfully Send Control\r\n    Given user on the Cafes and Coffee Shops Page\r\n    When sendkeys Lets Grab a Coffee Area Full Name: \"<fullName>\" on Cafes and Coffee Shops Page\r\n    When sendkeys Lets Grab a Coffee Area Mail: \"<mail>\" on Cafes and Coffee Shops Page\r\n    When sendkeys Lets Grab a Coffee Area Contact Number: \"<contactNumber>\" on Cafes and Coffee Shops Page\r\n    When sendkeys Lets Grab a Coffee Area Business Name: \"<businessName>\" on Cafes and Coffee Shops Page\r\n    When select Lets Grab a Coffee Area Type of Business: \"<type>\" on Cafes and Coffee Shops Page\r\n    When sendkeys Lets Grab a Coffee Area Tell us: \"<tellUs>\" on Cafes and Coffee Shops Page\r\n    When click Lets Grab a Coffee Area Send Button on Cafes and Coffee Shops Page\r\n    Then should see Popup Message: \"Your message has been sent successfully.\"\r\n    Then should see Popup Icon\r\n    Then should see Popup Close Icon\r\n    Examples:\r\n      | fullName | mail          | contactNumber | businessName | type  | tellUs  |\r\n      | Enes     | mail@mail.com | +905439459532 | ronwell      | Hotel | tell us |\r\n\r\n  @LetsGrabaCoffeeArea @Empty\r\n  Scenario: Lets Grab a Coffee Area Empty Fields Send Control\r\n    Given user on the Cafes and Coffee Shops Page\r\n    When click Lets Grab a Coffee Area Send Button on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Full Name Error: \"This is required.\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Email Error: \"Email is invalid.\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Contact Number Error: \"Invalid Phone\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Business Name Error: \"This is required.\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Error: \"This is required.\" on Cafes and Coffee Shops Page\r\n    Then should see Lets Grab a Coffee Area Tell us Error: \"This is required.\" on Cafes and Coffee Shops Page\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Ronwell/Desktop/TraumKaffee2/src/test/resources/features/CafesAndCoffeeShopsPage.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@CafesAndCoffeeShopsPage","id":"5c81b213-98c1-4b68-805c-74778822ccbd"}],"language":"en","keyword":"Feature","name":"Cafes And Coffee Shops Pag to perfection, ensuring a rich and flavorful coffee experience every time.\" on Coffee At Work Page\r\n    Then should see The Favorite Drink Area Title: \"The favorite drink of white-collar workers? It's no secret - coffee! \" on Coffee At Work Page\r\n    Then should see The Favorite Drink Area Description: \"With Traum's premium coffee beans, they can enjoy a delicious and unforgettable coffee experience that will help them power through their busy workdays with ease.\" on Coffee At Work Page\r\n    Then should see The Favorite Drink Area Image on Coffee At Work Page\r\n    Then should see Brewing Great Area Title: \"Brewing Great Coffee In The Office\" on Coffee At Work Page\r\n    Then should see Brewing Great Area Description: \"Serving great coffee in the office requires more than just a coffee pot and some beans. To provide a truly satisfying coffee experience for employees, offices need high-quality coffee beans that are freshly roasted and ground.Reliable coffee-making equipment is also essential. Providing a variety of coffee blends and single origin flavors can cater to different tastes and preferences among employees.\" on Coffee At Work Page\r\n    Then should see Brewing Great Area Image on Coffee At Work Page\r\n    Then should see Brewing Great Area Equipment Button: \"EQUIPMENT\" on Coffee At Work Page\r\n    Then should see Engaging Coffee Area Title: \"Engaging Coffee Workshop For Office Workers\" on Coffee At Work Page\r\n    Then should see Engaging Coffee Area Description: \"Let Traum guide you through an immersive workshop or a short-term training session where you can learn all about the art of coffee making. Our expert coffee trainers will teach you the secrets behind our premium coffee.\" on Coffee At Work Page\r\n    Then should see Engaging Coffee Area Image on Coffee At Work Page\r\n    Then should see Engaging Coffee Area Training Button: \"TRAINING\" on Coffee At Work Page\r\n    Then should see A Coffee Break Area Title: \"A Coffee Break At Work?\" on Coffee At Work Page\r\n    Then should see A Coffee Break Area Description: \"At Traum, we believe that a great cup of coffee can do more than just energize you for work - it can also create a sense of community among office workers. That's why we offer high-quality coffee that is designed to make you feel like you're catching up with friends over a cup of coffee, even when you're at work.Our ethically sourced and expertly roasted coffee beans offer a delicious and memorable coffee experience that will leave you feeling relaxed and refreshed, just like you've taken a break with your colleagues.\" on Coffee At Work Page\r\n    Then should see A Coffee Break Area Image on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Title: \"Let's Grab a Coffee!\" on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Description: \"For more information on how to partner with us and to learn more about our wholesale coffee program,contact us now!\" on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Full Name: \"Full Name\" on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Email: \"Email\" on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Contact Number: \"Contact Number\" on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Business Name: \"Business Name\" on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Type of Business: \"Type of Business\" on Coffee At Work Page\r\n    When click Lets Grab a Coffee Area Type of Busines on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Hotel\" on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Restaurant\" on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Cafe\" on Coffee At Work Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Offi 8d2c-5cd0918fb4d2"}],"astNodeIds":["957932e4-ad9a-4224-87c8-b3c1b17734b2"]}},{"source":{"uri":"file:///C:/Users/Ronwell/Desktop/TraumKaffee2/src/test/resources/features/CoffeeForHotelsPage.feature","data":"@CoffeeForHotelsPage\r\nFeature: Coffee For Hotels Page\r\n\r\n  @CoffeeForRestaurantArea @TextAndComponent\r\n  Scenario: Coffee For Hotels Area Text and Component Control\r\n    Given user on the Coffee for Hotels Page\r\n    Then should see Coffee For Hotels Area Title: \"Coffee For Hotels\" on Coffee for Hotels Page\r\n    Then should see Coffee For Hotels Area Description: \"Looking for the perfect coffee partner for your hotel? Look no further than Traum Kaffee!\" on Coffee for Hotels Page\r\n    Then should see Coffee For Hotels Area Image on Coffee for Hotels Page\r\n    Then should see Description Area Description: \"Our exceptional coffee is crafted from high-quality, sustainably sourced beans and roasted to perfection, resulting in a rich and flavorful experience that your guests won't forget.Traum is not like other hotel coffee suppliers. We also offer specialized coffee workshops for hotel guests and expert training for hotel staff to ensure that your coffee offerings are second to none.Let us help you elevate your hotel's coffee game and provide an unforgettable experience for your guests.\" on Coffee for Hotels Page\r\n    Then should see Taste Difference Area Title: \"Taste the Difference: Traum Commitment to Quality Coffee\" on Coffee for Hotels Page\r\n    Then should see Taste Difference Area Description: \"We believe that quality is key when it comes to coffee. That's why we source only the finest beans from around the world and expertly roast them to bring out their unique flavor profiles. Our commitment to quality extends beyond the beans themselves - we also provide customized solutions for hotels and other businesses to ensure that their coffee offerings meet their specific needs and preferences.\" on Coffee for Hotels Page\r\n    Then should see Taste Difference Area Image on Coffee for Hotels Page\r\n    Then should see Coffee Revolation Area Title: \"The Coffee Revolution: Where Innovation Meets Taste\" on Coffee for Hotels Page\r\n    Then should see Coffee Revolation Area Description: \"We believe in pushing the boundaries of what is possible when it comes to coffee. Our team of expert roasters and baristas is always experimenting with new blends, brewing methods, and flavor profiles to offer our customers something truly unique.We also offer specialized training for hotel staff to ensure that they can provide the best possible coffee experience for their guests.\" on Coffee for Hotels Page\r\n    Then should see Coffee Revolation Area Image on Coffee for Hotels Page\r\n    Then should see Brewing With Hospitally Area Title: \"Brewing with Hospitality\" on Coffee for Hotels Page\r\n    Then should see Brewing With Hospitally Area Description: \"We are passionate about providing exceptional customer service to our partners.We believe in building long-term partnerships with our customers and working closely with them to meet their specific needs. Whether you are a hotel manager, food and beverage director, or executive chef, we are here to provide you with personalized solutions and support.\" on Coffee for Hotels Page\r\n    Then should see Brewing With Hospitally Area Image on Coffee for Hotels Page\r\n    Then should see Sustainably Delicious Area Title: \"Sustainably Delicious\" on Coffee for Hotels Page\r\n    Then should see Sustainably Delicious Area Description: \"We are committed to sustainability in every aspect of our business, from the way we source our beans to the materials we use in our packaging. We work with farmers who use sustainable growing practices.\" on Coffee for Hotels Page\r\n    Then should see Sustainably Delicious Area Image on Coffee for Hotels Page\r\n    Then should see From Barista Area Title: \"From Barista to Pro: Specialized Coffee Training for Hotel Staff\" on Coffee for Hotels Page\r\n    Then should see From Barista Area Description: \"We also offer specialized training for hotel staff to ensure that they can provide the best possible coffee experience for their guests. By working closely with hotel staff, we help them to improve their skills and knowledge, which in turn leads to happy and satisfied guests.\" on Coffee for Hotels Page\r\n    Then should see From Barista Area Image on Coffee for Hotels Page\r\n    Then should see From Barista Area Training Button: \"TRAINING\" on Coffee for Hotels Page\r\n    Then should see What Makes Us Area Title: \"What makes us your perfect partner?\" on Coffee for Hotels Page\r\n    Then should see What Makes Us Area Description: \"At Traum Kaffee, we go beyond supplying coffee. We offer a comprehensive range of services to enhance your coffee experience. We help you choose the right coffee machine, provide regular technical and quality service, and offer professional barista training for you and your team. From installation to serving your first cup of coffee, we take care of everything so you can focus on your business.\" on Coffee for Hotels Page\r\n    Then should see What Makes Us Area Image on Coffee for Hotels Page\r\n    Then should see Lets Grab a Coffee Area Title: \"Let's Grab a Coffee!\" on Coffee for Hotels Page\r\n    Then should see Lets Grab a Coffee Area Description: \"For more information on how to partner with us and to learn more about our wholesale coffee program,contact us now!\" on Coffee for Hotels Page\r\n    Then should see Lets Grab a Coffee Area Full Name: \"Full Name\" on Coffee for Hotels Page\r\n    Then should see Lets Grab a Coffee Area Email: \"Email\" on Coffee for Hotels Page\r\n    Then should see Lets Grab a Coffee Area Contact Number: \"Contact Number\" on Coffee for Hotels Page\r\n    Then should see Lets Grab a Coffee Area Business Name: \"Business Name\" on Coffee for Hotels Page\r\n    Then should see Lets Grab a Coffee Area Type of Busines , bold flavors and aromas that will satisfy and refresh your customers.Our team of coffee experts is available to offer advice and insights on customer preferences, as well as provide timely delivery of food service supplies. With our comprehensive restaurant coffee program, restaurant owners can focus on running their businesses while we take care of the coffee.\" on Coffee for Restaurant Page\r\n    Then should see Why Partner Area Title: \"Looking for the perfect cup of coffee to complement your restaurant's delicious cuisine?\" on Coffee for Restaurant Page\r\n    Then should see Why Partner Area Description: \"Look no further! Our high-quality coffee beans are carefully sourced and expertly roasted to create a rich, complex flavor that will elevate your guests' dining experience to new heights.\" on Coffee for Restaurant Page\r\n    Then should see Why Partner Area Image on Coffee for Restaurant Page\r\n    Then should see Our Commitment Area Title: \"Our Commitment To Quality Doesn'T End There\" on Coffee for Restaurant Page\r\n    Then should see Our Commitment Area Description: \"We also provide training and support to our restaurant partners to ensure that our coffee is prepared and served in the best possible way. From expert barista training to custom brewing guides, we are here to help you create the perfect cup of coffee every time.\" on Coffee for Restaurant Page\r\n    Then should see Our Commitment Area Training Button: \"TRAINING\" on Coffee for Restaurant Page\r\n    Then should see Our Commitment Area Image on Coffee for Restaurant Page\r\n    Then should see Why Settle Area Title: \"Why Settle For Ordinary Coffee When You Can Offer Your Guests Something Truly Special?\" on Coffee for Restaurant Page\r\n    Then should see Why Settle Area Description: \"Our high-quality coffee will not only satisfy your customers' caffeine cravings but will also leave them with a lasting impression of your restaurant's commitment to excellence. We offer them coffee workshops led by our expert baristas.\" on Coffee for Restaurant Page\r\n    Then should see Why Settle Area Image on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Title: \"Let's Grab a Coffee!\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Description: \"For more information on how to partner with us and to learn more about our wholesale coffee program,contact us now!\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Full Name: \"Full Name\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Email: \"Email\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Contact Number: \"Contact Number\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Business Name: \"Business Name\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Type of Business: \"Type of Business\" on Coffee for Restaurant Page\r\n    When click Lets Grab a Coffee Area Type of Busines on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Hotel\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Restaurant\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Cafe\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Office\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Events\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Other\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Tell us: \"Tell us a bit about your business... the more info the better!\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Send Button: \"SEND\" on Coffee for Restaurant Page\r\n\r\n  @OurCommitmentArea @Navigation\r\n  Scenario: Our Commitment Area Navigation Control\r\n    Given user on the Coffee for Restaurant Page\r\n    When click Our Commitment Area Training Button on Coffee for Restaurant Page\r\n    Then should see the Training Page\r\n\r\n  @LetsGrabaCoffeeArea @Successfully\r\n  Scenario Outline: Lets Grab a Coffee Area Successfully Send Control\r\n    Given user on the Coffee for Restaurant Page\r\n    When sendkeys Lets Grab a Coffee Area Full Name: \"<fullName>\" on Coffee for Restaurant Page\r\n    When sendkeys Lets Grab a Coffee Area Mail: \"<mail>\" on Coffee for Restaurant Page\r\n    When sendkeys Lets Grab a Coffee Area Contact Number: \"<contactNumber>\" on Coffee for Restaurant Page\r\n    When sendkeys Lets Grab a Coffee Area Business Name: \"<businessName>\" on Coffee for Restaurant Page\r\n    When select Lets Grab a Coffee Area Type of Business: \"<type>\" on Coffee for Restaurant Page\r\n    When sendkeys Lets Grab a Coffee Area Tell us: \"<tellUs>\" on Coffee for Restaurant Page\r\n    When click Lets Grab a Coffee Area Send Button on Coffee for Restaurant Page\r\n    Then should see Popup Message: \"Your message has been sent successfully.\"\r\n    Then should see Popup Icon\r\n    Then should see Popup Close Icon\r\n    Examples:\r\n      | fullName | mail | contactNumber | businessName | type | tellUs |\r\n      | Enes     | mail@mail.com | +905439459532 | ronwell      | Hotel | tell us |\r\n\r\n  @LetsGrabaCoffeeArea @Empty\r\n  Scenario: Lets Grab a Coffee Area Empty Fields Send Control\r\n    Given user on the Coffee for Hotels Page\r\n    When click Lets Grab a Coffee Area Send Button on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Full Name Error: \"This is required.\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Email Error: \"Email is invalid.\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Contact Number Error: \"Invalid Phone\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Business Name Error: \"This is required.\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Error: \"This is required.\" on Coffee for Restaurant Page\r\n    Then should see Lets Grab a Coffee Area Tell us Error: \"This is required.\" on Coffee for Restaurant Page\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Ronwell/Desktop/TraumKaffee2/src/test/resources/features/CoffeeForRestaurantPage.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@CoffeeForRestaurantPage","id":"6c1d4a9e-b25f-4b7e-ab58-a78fdea2d3d5"}],"language":"en","keyword":"Feature","name":"Coffee For Restaurant Page","description":"","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@CoffeeForRestaurantArea","id":"c67746a7-df04-4d6e-b9d8-ee07605894d1"},{"location":{"line":4,"column":28},"name":"@TextAndComponent","id":"11fd8ae1-4ac4-4d33-a12c-20efb502eb55"}],"keyword":"Scenario","name":"Coffee For Restaurant Area Text and Component Control","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"user on the Coffee for Restaurant Page","id":"13559242-811c-4fff-bb59-546361616bdd"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see Coffee For Restaurant Area Title: \"Coffee For Restaurant\" on Coffee for Restaurant Page","id":"6ec3553c-8b26-4294-83f5-df2a74047e42"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see Coffee For Restaurant Area Description: \"If your business serves coffee, Traum Kaffee is your perfect partner. Whether you own a small venue or a restaurant chain, we provide the perfect coffee for you and your customers.\" on Coffee for R  should see Equipment Area Description: \"At Traum Kaffee, we are dedicated to supplying the best equipment to make the best coffee.\" on Equipment Page\r\n    Then should see Equipment Area Image on Equipment Page\r\n    Then should see Description Area Description: \"We provide comprehensive training, installation, and ongoing service to ensure you get the best out of your equipment.We are here to support you every step of the way, from installation to ongoing maintenance and service, to ensure your coffee business succeeds.\" on Equipment Page\r\n    Then should see High Quality Coffee Area Title: \"High-Quality Coffee Machines and Grinders\" on Equipment Page\r\n    Then should see High Quality Coffee Area Description: \"At Traum Kaffee, we understand the importance of investing in high-quality coffee machines and grinders to ensure your coffee tastes consistently delicious. That’s why we have established partnerships with only the most reputable and industry-leading brands to provide you with the best possible equipment options. Our machines are carefully selected to meet the highest standards of quality, durability, and performance, so you can have confidence in your investment.Our knowledgeable team can guide you through the selection process to ensure you choose the right equipment for your specific needs and preferences. Whether you’re looking for precision, speed, ease of use, or all of the above, we have the perfect machine for you.With Traum, you can have peace of mind knowing that you are investing in the highest quality coffee equipment and service available in the industry.\" on Equipment Page\r\n    Then should see High Quality Coffee Area Image on Equipment Page\r\n    Then should see Installation Area Title: \"Installation\" on Equipment Page\r\n    Then should see Installation Area Description: \"We understand that proper installation is crucial to ensuring your coffee equipment operates correctly and produces the best possible coffee.Our experienced technicians will handle the installation process with care and attention to detail, ensuring your equipment is set up according to manufacturer specifications and local regulations.We also provide guidance on optimal placement and setup to ensure that your equipment is both functional and aesthetically pleasing. Our goal is to provide you with a seamless installation process that minimizes downtime and maximizes your return on investment.\" on Equipment Page\r\n    Then should see Installation Area Image on Equipment Page\r\n    Then should see Comprehensive Training Area Title: \"Comprehensive Training\" on Equipment Page\r\n    Then should see Comprehensive Training Area Description: \"At Traum Kaffee, we take pride in providing our customers with the highest level of service and expertise.We offer comprehensive training to ensure that you are able to use your new equipment effectively and efficiently. Our experienced technicians will guide you through the setup process, demonstrate how to use the machine, and provide tips on maintenance and cleaning.Our goal is to empower you to create the best possible coffee experience for your customers, and we believe that proper training is essential to achieving that goal.\" on Equipment Page\r\n    Then should see Comprehensive Training Area Image on Equipment Page\r\n    Then should see Ongoing Technical Area Title: \"Ongoing Technical Service\" on Equipment Page\r\n    Then should see Ongoing Technical Area Description: \"We want our customers' coffee equipment to be always in top condition.That’s why we offer ongoing service to provide regular maintenance and support for your coffee machines and grinders. Our team is available to diagnose and repair any issues that may arise, ensuring that your equipment operates at peak performance.Our goal is to provide you with peace of mind and the knowledge that your coffee equipment will always be operating at its best so that you can focus on creating the perfect cup of coffee for your customers.\" on Equipment Page\r\n    Then should see Ongoing Technical Area Image on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Title: \"Let's Grab a Coffee!\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Description: \"For more information on how to partner with us and to learn more about our wholesale coffee program,contact us now!\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Full Name: \"Full Name\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Email: \"Email\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Contact Number: \"Contact Number\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Business Name: \"Business Name\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Type of Business: \"Type of Business\" on Equipment Page\r\n    When click Lets Grab a Coffee Area Type of Busines on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Hotel\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Restaurant\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Cafe\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Office\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Events\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Other\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Tell us: \"Tell us a bit about your business... the more info the better!\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Send Button: \"SEND\" on Equipment Page\r\n\r\n  @LetsGrabaCoffeeArea @Successfully\r\n  Scenario Outline: Lets Grab a Coffee Area Successfully Send Control\r\n    Given user on the Equipment Page\r\n    When sendkeys Lets Grab a Coffee Area Full Name: \"<fullName>\" on Equipment Page\r\n    When sendkeys Lets Grab a Coffee Area Mail: \"<mail>\" on Equipment Page\r\n    When sendkeys Lets Grab a Coffee Area Contact Number: \"<contactNumber>\" on Equipment Page\r\n    When sendkeys Lets Grab a Coffee Area Business Name: \"<businessName>\" on Equipment Page\r\n    When select Lets Grab a Coffee Area Type of Business: \"<type>\" on Equipment Page\r\n    When sendkeys Lets Grab a Coffee Area Tell us: \"<tellUs>\" on Equipment Page\r\n    When click Lets Grab a Coffee Area Send Button on Equipment Page\r\n    Then should see Popup Message: \"Your message has been sent successfully.\"\r\n    Then should see Popup Icon\r\n    Then should see Popup Close Icon\r\n    Examples:\r\n      | fullName | mail          | contactNumber | businessName | type  | tellUs  |\r\n      | Enes     | mail@mail.com | +905439459532 | ronwell      | Hotel | tell us |\r\n\r\n  @LetsGrabaCoffeeArea @Empty\r\n  Scenario: Lets Grab a Coffee Area Empty Fields Send Control\r\n    Given user on the Equipment Page\r\n    When click Lets Grab a Coffee Area Send Button on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Full Name Error: \"This is required.\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Email Error: \"Email is invalid.\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Contact Number Error: \"Invalid Phone\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Business Name Error: \"This is required.\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Error: \"This is required.\" on Equipment Page\r\n    Then should see Lets Grab a Coffee Area Tell us Error: \"This is required.\" on Equipment Page\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Ronwell/Desktop/TraumKaffee2/src/test/resources/features/EquipmentsPage.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line": o provide guidance on optimal placement and setup to ensure that your equipment is both functional and aesthetically pleasing. Our goal is to provide you with a seamless installation process that minimizes downtime and maximizes your return on investment.\" on Equipment Page","id":"c14cc83c-716f-4241-bd24-4928014d5e96"},{"location":{"line":16,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see Installation Area Image on Equipment Page","id":"6eb2549e-73ca-4067-994e-0ea3e969f7e8"},{"location":{"line":17,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see Comprehensive Training Area Title: \"Comprehensive Training\" on Equipment Page","id":"ff5e66ca-81a1-4a9c-9925-ded7b3c34249"},{"location":{"line":18,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see Comprehensive Training Area Description: \"At Traum Kaffee, we take pride in providing our customers with the highest level of service and expertise.We offer comprehensive training to ensure that you are able to use your new equipment effectively and efficiently. Our experienced technicians will guide you through the setup process, demonstrate how to use the machine, and provide tips on maintenance and cleaning.Our goal is to empower you to create the best possible coffee experience for your customers, and we believe that proper training is essential to achieving that goal.\" on Equipment Page","id":"5de46f74-c798-4717-a954-db0ba85c4e09"},{"location":{"line":19,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see Comprehensive Training Area Image on Equipment Page","id":"385cd7e6-0ca4-4698-89ab-c4815869eaf6"},{"location":{"line":20,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see Ongoing Technical Area Title: \"Ongoing Technical Service\" on Equipment Page","id":"8437e16a-28a8-4637-bb3f-00ae10a5ad0a"},{"location":{"line":21,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see Ongoing Technical A elp With Area Shop: \"Shop\" on FAQ Page\r\n    Then should see Help With Area My Orders: \"My Orders\" on FAQ Page\r\n    Then should see Help With Area Brew Guides: \"Brew Guides\" on FAQ Page\r\n    Then should see Help With Area ContactUs: \"Contact Us\" on FAQ Page\r\n    Then should see FAQ Area Title: \"FAQ\" on FAQ Page\r\n    Then should see FAQ Area Question One: \"What Is Traum?\" on FAQ Page\r\n    When click FAQ Area Question One on FAQ Page\r\n    Then should see FAQ Area Answer One: \"Traum Kaffee is a retail and wholesale coffee brand that focuses on producing high-quality coffee using German roasting automation technology to ensure consistency.\" on FAQ Page\r\n    Then should see FAQ Area Question Two: \"Are The Coffees Whole Bean Or Ground?\" on FAQ Page\r\n    When click FAQ Area Question Two on FAQ Page\r\n    Then should see FAQ Area Answer Two: \"We provide both whole and ground coffee. Most customers prefer whole beans if they have a coffee grinder. A cup of coffee that has been freshly roasted and the ground is the finest way to enjoy its full flavor.\" on FAQ Page\r\n    Then should see FAQ Area Question Three: \"What Is A Grinding Method?\" on FAQ Page\r\n    When click FAQ Area Question Three on FAQ Page\r\n    Then should see FAQ Area Answer Three: \"The grinding method is breaking down coffee beans into smaller particles for brewing. At Traum Kaffee, we have multiple grinding methods available. You can explore different options by visiting our ‘’Shop’’ section on our website.\" on FAQ Page\r\n    Then should see FAQ Area Question Four: \"What Are The Coffee Storage Conditions?\" on FAQ Page\r\n    When click FAQ Area Question Four on FAQ Page\r\n    Then should see FAQ Area Answer Four: \"Coffee should be stored in a cool, dry, and dark place, away from heat, moisture, and light, in an airtight container. It is important to avoid exposing coffee to oxygen, as this can cause the coffee to become stale more quickly.\" on FAQ Page\r\n    Then should see FAQ Area Question Five: \"What Do We Need To Do To Place A Bulk Or Corporate Order?\" on FAQ Page\r\n    When click FAQ Area Question Five on FAQ Page\r\n    Then should see FAQ Area Answer Five: \"To place a bulk or corporate order, please visit our Wholesale Coffee page and fill out the provided form, which will help us gather the necessary information and expedite the ordering process.\" on FAQ Page\r\n    Then should see FAQ Area Question Six: \"If I Make A Return/Cancellation, When Will I Get A Refund?\" on FAQ Page\r\n    When click FAQ Area Question Six on FAQ Page\r\n    Then should see FAQ Area Answer Six: \"For non-coffee orders, once we receive your returned item and inspect it, we will notify you of the status of your refund. If your return is approved, we will initiate a refund to your credit card (or original method of payment). You can expect to receive the credit within 3-4 business days, depending on your card issuer's policies.For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page\r\n    Then should see FAQ Area Pagination Left Icon on FAQ Page\r\n    Then should see FAQ Area Pagination Right Icon on FAQ Page\r\n    Then should see FAQ Area Pagination Text: \"1\" on FAQ Page\r\n    Then should see FAQ Area Pagination Text: \"2\" on FAQ Page\r\n    When click Second Page on Pagionation on FAQ Page\r\n    Then should see FAQ Area Title: \"FAQ\" on FAQ Page\r\n    Then should see FAQ Area Question One: \"How Can I Cancel My Order? How Can I Cancel My Order?\" on FAQ Page\r\n    When click FAQ Area Question One on FAQ Page\r\n    Then should see FAQ Area Answer One: \"We understand that sometimes plans change, and you may need to cancel your order. To cancel an order, you must contact us by emailing ‘contact@traumkaffee.com’ at least 12 hours before delivery. Once your shipment is on the way to you, we will not be able to cancel it. For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page\r\n    Then should see FAQ Area Question Two: \"How Can I Return My Order?\" on FAQ Page\r\n    When click FAQ Area Question Two on FAQ Page\r\n    Then should see FAQ Area Answer Two: \"For non-coffee orders, you have 7 calendar days from the date of the invoice to return an item. To be eligible for a return, your item must be unused, not damaged, and in the same condition that you received it. It must also be in its original packaging and have a receipt or proof of purchase. For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page\r\n    Then should see FAQ Area Question Three: \"My Order Was Delivered Faulty / Damaged; What Should I Do?\" on FAQ Page\r\n    When click FAQ Area Question Three on FAQ Page\r\n    Then should see FAQ Area Answer Three: \"If your order is delivered faulty or damaged, please contact our customer service team as soon as possible. You can reach us by email at contact@traumkaffee.com or through our website's contact form. Please note that this policy only applies to non-coffee orders; we do not offer returns or refunds for coffee that has been delivered.For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page\r\n\r\n\r\n  @HelpWithArea @Navigaiton @Shop\r\n  Scenario: Help With Area Navigation Control\r\n    Given user on the FAQ Page\r\n    When click Help With Area Shop on FAQ Page\r\n    Then should see the Home Page\r\n\r\n  @HelpWithArea @Navigaiton @All\r\n  Scenario: Help With Area Navigation Control\r\n    Given user on the FAQ Page\r\n    When click Help With Area My Orders on FAQ Page\r\n    Then should see the Sign In Page\r\n\r\n  @HelpWithArea @Navigaiton @All\r\n  Scenario: Help With Area Navigation Control with Sign In\r\n    Given user on the FAQ Page\r\n    Given successfully Sign In with Mail:\"faqsTestAutomation1@ronwell.net\" and Pas coffee that has been freshly roasted and the ground is the finest way to enjoy its full flavor.\" on FAQ Page","id":"08f629fd-263d-40c3-8a39-bc68be6f1e61"},{"location":{"line":19,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Question Three: \"What Is A Grinding Method?\" on FAQ Page","id":"2bd01a9d-c333-4beb-8b80-982e8c177252"},{"location":{"line":20,"column":5},"keyword":"When ","keywordType":"Action","text":"click FAQ Area Question Three on FAQ Page","id":"744b5c21-2464-4a4b-bf5a-de3ee7180dad"},{"location":{"line":21,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Answer Three: \"The grinding method is breaking down coffee beans into smaller particles for brewing. At Traum Kaffee, we have multiple grinding methods available. You can explore different options by visiting our ‘’Shop’’ section on our website.\" on FAQ Page","id":"1b198309-1824-465d-9712-dc32773302b3"},{"location":{"line":22,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Question Four: \"What Are The Coffee Storage Conditions?\" on FAQ Page","id":"98f07d41-b73b-4fed-95e3-8cc1b3b37f44"},{"location":{"line":23,"column":5},"keyword":"When ","keywordType":"Action","text":"click FAQ Area Question Four on FAQ Page","id":"1df52b4b-a9b8-400e-a82e-244da0fe0016"},{"location":{"line":24,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Answer Four: \"Coffee should be stored in a cool, dry, and dark place, away from heat, moisture, and light, in an airtight container. It is important to avoid exposing coffee to oxygen, as this can cause the coffee to become stale more quickly.\" on FAQ Page","id":"fd89754e-79b0-441e-8c92-89b0e9e641b4"},{"location":{"line":25,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Question Five: \"What Do We Need To Do To Place A Bulk Or Corporate Order?\" on FAQ Page","id":"993588cc-f14f-429b-8535-1a8b52dd2878"},{"location":{"line":26,"column":5},"keyword":"When ","keywordType":"Action","text":"click FAQ Area Question Five on FAQ Page","id":"da24f157-7963-4551-91d1-301bfd29ad79"},{"location":{"line":27,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Answer Five: \"To place a bulk or corporate order, please visit our Wholesale Coffee page and fill out the provided form, which will help us gather the necessary information and expedite the ordering process.\" on FAQ Page","id":"4e09fb8f-4873-44dd-bdd4-0fc821da57ac"},{"location":{"line":28,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Question Six: \"If I Make A Return/Cancellation, When Will I Get A Refund?\" on FAQ Page","id":"baabf52c-11e2-4794-b0aa-11896f830269"},{"location":{"line":29,"column":5},"keyword":"When ","keywordType":"Action","text":"click FAQ Area Question Six on FAQ Page","id":"0750974b-dacf-4bd6-8c02-e639aa7f14f1"},{"location":{"line":30,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Answer Six: \"For non-coffee orders, once we receive your returned item and inspect it, we will notify you of the status of your refund. If your return is approved, we will initiate a refund to your credit card (or original method of payment). You can expect to receive the credit within 3-4 business days, depending on your card issuer's policies.For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page","id":"83dc5ce5-fa5e-45f1-baed-038e21f23a79"},{"location":{"line":31,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Pagination Left Icon on FAQ Page","id":"14e1b341-5033-44d8-9f33-3b653980a17a"},{"location":{"line":32,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Pagination Right Icon on FAQ Page","id":"1c9fab16-3b5e-4ab4-81a4-07b5e5491984"},{"location":{"line":33,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Pagination Text: \"1\" on FAQ Page","id":"809c1d18-12e0-44e1-bfbc-86fe796957d8"},{"location":{"line":34,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Pagination Text: \"2\" on FAQ Page","id":"f4f90ba2-225f-495f-ba89-9b5780f18749"},{"location":{"line":35,"column":5},"keyword":"When ","keywordType":"Action","text":"click Second Page on Pagionation on FAQ Page","id":"13e3aeb0-9549-413a-822a-a68a27ed688c"},{"location":{"line":36,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Title: \"FAQ\" on FAQ Page","id":"22d352b9-39e2-4564-9fc7-2bd5bdeeee48"},{"location":{"line":37,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Question One: \"How Can I Cancel My Order? How Can I Cancel My Order?\" on FAQ Page","id":"6f935420-1e8a-4e8e-9bc8-cc04f362787b"},{"location":{"line":38,"column":5},"keyword":"When ","keywordType":"Action","text":"click FAQ Area Question One on FAQ Page","id":"62969448-c6f9-4125-b4bb-11e89248c546"},{"location":{"line":39,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Answer One: \"We understand that sometimes plans change, and you may need to cancel your order. To cancel an order, you must contact us by emailing ‘contact@traumkaffee.com’ at least 12 hours before delivery. Once your shipment is on the way to you, we will not be able to cancel it. For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page","id":"86c016ec-79e3-4f67-88b6-8f5f8c670c0c"},{"location":{"line":40,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Question Two: \"How Can I Return My Order?\" on FAQ Page","id":"2ca285c6-949a-4622-8572-ec1a018ab7a3"},{"location":{"line":41,"column":5},"keyword":"When ","keywordType":"Action","text":"click FAQ Area Question Two on FAQ Page","id":"7e0482e3-5a95-4918-aabc-9e6a00c9f937"},{"location":{"line":42,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Answer Two: \"For non-coffee orders, you have 7 calendar days from the date of the invoice to return an item. To be eligible for a return, your item must be unused, not damaged, and in the same condition that you received it. It must also be in its original packaging and have a receipt or proof of purchase. For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page","id":"9319ec35-1234-406c-8970-7fb2e7a57ddd"},{"location":{"line":43,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Question Three: \"My Order Was Delivered Faulty / Damaged; What Should I Do?\" on FAQ Page","id":"833fe001-4f5b-421c-b0e8-3709581f1818"},{"location":{"line":44,"column":5},"keyword":"When ","keywordType":"Action","text":"click FAQ Area Question Three on FAQ Page","id":"4c2e0a78-d665-482f-b055-cbb9ad836cd5"},{"location":{"line":45,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"should see FAQ Area Answer Three: \"If your order is delivered faulty or damaged, please contact our customer service team as soon as possible. You can reach us by email at contact@traumkaffee.com or through our website's contact form. Please note that this policy only applies to non-coffee orders; we do not offer returns or refunds for coffee that has been delivered.For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page","id":"77b40c37-27a4-46ac-8405-529ca7e1fd21"}],"examples":[],"id":"7f473377-8b12-4cf2-b6d4-0c45aeaec901"}},{"scenario":{"location":{"line":49,"column":3},"tags":[{"location":{"line":48,"column":3},"name":"@HelpWithArea","id":"5db9b84d-2ea5-420c-a981-a8145e99a175"},{"location":{"line":48,"column":17},"name":"@Navigaiton","id":"64928927-a756-4b25-b297-c178656f3e2a"},{"location":{"line":48,"column":29},"name":"@Shop","id":"a31bcb4e-4a10-4a75-95e7- 21da57ac"],"id":"790b0b85-58c1-4927-b33e-b3e63e045081","type":"Outcome","text":"should see FAQ Area Answer Five: \"To place a bulk or corporate order, please visit our Wholesale Coffee page and fill out the provided form, which will help us gather the necessary information and expedite the ordering process.\" on FAQ Page"},{"astNodeIds":["baabf52c-11e2-4794-b0aa-11896f830269"],"id":"1fd70dbd-1745-4071-8dda-6517d1f6e188","type":"Outcome","text":"should see FAQ Area Question Six: \"If I Make A Return/Cancellation, When Will I Get A Refund?\" on FAQ Page"},{"astNodeIds":["0750974b-dacf-4bd6-8c02-e639aa7f14f1"],"id":"aeb39fdb-d231-4706-bae9-4fb68170983a","type":"Action","text":"click FAQ Area Question Six on FAQ Page"},{"astNodeIds":["83dc5ce5-fa5e-45f1-baed-038e21f23a79"],"id":"cc9341a1-bb37-476e-9bcc-a1847bbe25d1","type":"Outcome","text":"should see FAQ Area Answer Six: \"For non-coffee orders, once we receive your returned item and inspect it, we will notify you of the status of your refund. If your return is approved, we will initiate a refund to your credit card (or original method of payment). You can expect to receive the credit within 3-4 business days, depending on your card issuer's policies.For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page"},{"astNodeIds":["14e1b341-5033-44d8-9f33-3b653980a17a"],"id":"7450b0e8-373d-4cfa-a1a8-af817136b610","type":"Outcome","text":"should see FAQ Area Pagination Left Icon on FAQ Page"},{"astNodeIds":["1c9fab16-3b5e-4ab4-81a4-07b5e5491984"],"id":"2a014822-1d25-4e3b-9594-5be377f8b350","type":"Outcome","text":"should see FAQ Area Pagination Right Icon on FAQ Page"},{"astNodeIds":["809c1d18-12e0-44e1-bfbc-86fe796957d8"],"id":"f6946eee-8df8-42c0-a142-07dd5323529d","type":"Outcome","text":"should see FAQ Area Pagination Text: \"1\" on FAQ Page"},{"astNodeIds":["f4f90ba2-225f-495f-ba89-9b5780f18749"],"id":"52fce030-9765-49c8-adb2-93e58cd9626a","type":"Outcome","text":"should see FAQ Area Pagination Text: \"2\" on FAQ Page"},{"astNodeIds":["13e3aeb0-9549-413a-822a-a68a27ed688c"],"id":"63d6e231-68eb-4b74-a7b7-3685245deb1a","type":"Action","text":"click Second Page on Pagionation on FAQ Page"},{"astNodeIds":["22d352b9-39e2-4564-9fc7-2bd5bdeeee48"],"id":"72ed2f3c-8b53-4660-ac9b-3500da98201d","type":"Outcome","text":"should see FAQ Area Title: \"FAQ\" on FAQ Page"},{"astNodeIds":["6f935420-1e8a-4e8e-9bc8-cc04f362787b"],"id":"76cdc386-fd3b-4ebe-8484-b02ea43fb2c1","type":"Outcome","text":"should see FAQ Area Question One: \"How Can I Cancel My Order? How Can I Cancel My Order?\" on FAQ Page"},{"astNodeIds":["62969448-c6f9-4125-b4bb-11e89248c546"],"id":"435cb69f-b150-48eb-ab42-b3a2053b7007","type":"Action","text":"click FAQ Area Question One on FAQ Page"},{"astNodeIds":["86c016ec-79e3-4f67-88b6-8f5f8c670c0c"],"id":"3ba14a78-f93c-4c4e-9e14-dce042c56954","type":"Outcome","text":"should see FAQ Area Answer One: \"We understand that sometimes plans change, and you may need to cancel your order. To cancel an order, you must contact us by emailing ‘contact@traumkaffee.com’ at least 12 hours before delivery. Once your shipment is on the way to you, we will not be able to cancel it. For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page"},{"astNodeIds":["2ca285c6-949a-4622-8572-ec1a018ab7a3"],"id":"dce05f71-4088-45c8-b530-4d2c793e501f","type":"Outcome","text":"should see FAQ Area Question Two: \"How Can I Return My Order?\" on FAQ Page"},{"astNodeIds":["7e0482e3-5a95-4918-aabc-9e6a00c9f937"],"id":"80ff0a10-7549-490c-9fad-b3e6d8e2377c","type":"Action","text":"click FAQ Area Question Two on FAQ Page"},{"astNodeIds":["9319ec35-1234-406c-8970-7fb2e7a57ddd"],"id":"a8e7a7bb-9a03-43f9-85b0-6fc631903970","type":"Outcome","text":"should see FAQ Area Answer Two: \"For non-coffee orders, you have 7 calendar days from the date of the invoice to return an item. To be eligible for a return, your item must be unused, not damaged, and in the same condition that you received it. It must also be in its original packaging and have a receipt or proof of purchase. For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page"},{"astNodeIds":["833fe001-4f5b-421c-b0e8-3709581f1818"],"id":"e5b40605-aa09-4188-a097-3366fe274ee6","type":"Outcome","text":"should see FAQ Area Question Three: \"My Order Was Delivered Faulty / Damaged; What Should I Do?\" on FAQ Page"},{"astNodeIds":["4c2e0a78-d665-482f-b055-cbb9ad836cd5"],"id":"b406eae4-a6b7-422d-8550-9dda850446e9","type":"Action","text":"click FAQ Area Question Three on FAQ Page"},{"astNodeIds":["77b40c37-27a4-46ac-8405-529ca7e1fd21"],"id":"92b41358-0ea6-4ea7-b513-8a1c7d564d89","type":"Outcome","text":"should see FAQ Area Answer Three: \"If your order is delivered faulty or damaged, please contact our customer service team as soon as possible. You can reach us by email at contact@traumkaffee.com or through our website's contact form. Please note that this policy only applies to non-coffee orders; we do not offer returns or refunds for coffee that has been delivered.For more information on our returns policy, please visit our website's Return and Refund Policy page.\" on FAQ Page"}],"tags":[{"name":"@FAQPage","astNodeId":"ab9b135b-f80c-4bc0-a90a-2eaaff2c4cc9"},{"name":"@HelpWithArea","astNodeId":"5961de12-8a66-494e-956b-f2bf553c3849"},{"name":"@TextAndComponent","astNodeId":"f8ba99c8-46b8-4bd8-ac98-988a0abc6860"}],"astNodeIds":["7f473377-8b12-4cf2-b6d4-0c45aeaec901"]}},{"pickle":{"id":"8ef75643-b665-4b70-ac17-9e63212c0451","uri":"file:///C:/Users/Ronwell/Desktop/TraumKaffee2/src/test/resources/features/FAQPage.feature","name":"Help With Area Navigation Control","language":"en","steps":[{"astNodeIds":["15e17f0a-9247-4745-9c84-81a6aa18cc15"],"id":"e847e4c6-b57f-415f-b531-44803dbd8a2c","type":"Context","text":"user on the FAQ Page"},{"astNodeIds":["1a27d3cb-ef52-41c4-aa32-5e86 ,{"astNodeIds":["89b8e2d0-1796-4944-9b22-6d429e6885e2"],"id":"3d1259ca-d5f8-4384-9e86-fff88a450250","type":"Action","text":"sendkeys Password: \"123123Test\" on Sign Up Page"},{"astNodeIds":["0ae10e99-0612-46e8-b12b-3a1b39fab104"],"id":"4d4337ff-ed21-467a-bf34-2d109dc95618","type":"Action","text":"sendkeys Confirm Password: \"123123Test\" on Sign Up Page"},{"astNodeIds":["1ff76abf-0d88-4212-bbfa-9a782c15bf44"],"id":"15e441e8-38ce-4f86-99f7-4d066441310e","type":"Action","text":"click Sign Up Button on Sign Up Page"},{"astNodeIds":["6d8f031e-381a-4194-85bf-3b662e8c1003"],"id":"26b775b6-55f1-4607-8786-1ac7e3129c34","type":"Outcome","text":"should see the Sign In Page"}],"tags":[{"name":"@SignUpPage","astNodeId":"b4335230-27cc-450c-8bac-320ecfb6f9eb"},{"name":"@SuccessfullSignUp","astNodeId":"0b7e8eed-1721-4e52-bf33-7f112e22aa42"}],"astNodeIds":["4a8fc2a4-9755-4b65-b3d4-78920c334044"]}},{"source":{"uri":"file:///C:/Users/Ronwell/Desktop/TraumKaffee2/src/test/resources/features/SustainabilityPage.feature","data":"@SustainabilityPage\r\nFeature: Sustainability Page\r\n\r\n  @TextAndComponent\r\n  Scenario: Sustainability Page Text and Component Control\r\n    Given user on the Sustainability Page\r\n    Then should see Sustainability Area Title: \"Sustainability\" on Sustainability Page\r\n    Then should see Sustainability Area Comment: \"“We Don’T Have To Engage In Grand, Heroic Actions To Participate In Change. Small Acts, When Multiplied By Millions Of People, Can Transform The World.”\" on Sustainability Page\r\n    Then should see Sustainability Area Commentor: \"-By Howard Zinn\" on Sustainability Page\r\n    Then should see Sustainability Area Image on Sustainability Page\r\n    Then should see Description Area Description: \"For us, sustainability means analyzing our conditions daily and making mindful choices depending on the outcomes of our actions. We are concerned about the sustainability of the world, businesses, and people directly or indirectly involved in our activities.We want a sustainable future for the whole coffee industry, one that is good for the environment, fair for farmers, and available to everyone.\" on Sustainability Page\r\n    Then should see Description Area Left Image on Sustainability Page\r\n    Then should see Description Area Right Image on Sustainability Page\r\n    Then should see What We Do Area Title: \"In Traum What We Do About Sustainability?\" on Sustainability Page\r\n    Then should see What We Do Area Sub Title: \"ENVIRONMENTAL SUSTAINABILITY\" on Sustainability Page\r\n    Then should see What We Do Area Description: \"Environmental sustainability to us refers to behaviors that protect our world and bring it no unnecessary damage. We've taken steps toward environmental sustainability by formulating an official environmental policy, buying supplies for our coffeehouse from local stores, and forming partnerships with coffee growers who share our commitment to sustainable business methods.\" on Sustainability Page\r\n    Then should see What We Do Area Slider on Sustainability Page\r\n    Then should see Our Traum Area Title: \"Our Traum For A Sustainable Future\" on Sustainability Page\r\n    Then should see Our Traum Area Left Up Image on Sustainability Page\r\n    Then should see Our Traum Area Left Up Title: \"EQUALITY OF PEOPLE\" on Sustainability Page\r\n    Then should see Our Traum Area Left Up Description: \"We believe in creating a better future for all. We proudly uphold Diversity, Equity & Inclusion in all aspects of our work, refusing to accept discrimination based on any factor.\" on Sustainability Page\r\n    Then should see Our Traum Area Left Down Image on Sustainability Page\r\n    Then should see Our Traum Area Left Down Title: \"ETHICALLY SOURCING\" on Sustainability Page\r\n    Then should see Our Traum Area Left Down Description: \"We prioritize ethically sourcing our coffee beans; working with local farmers and cooperatives to ensure fair labor practices and sustainable farming methods.\" on Sustainability Page\r\n    Then should see Our Traum Area Center Up Image on Sustainability Page\r\n    Then should see Our Traum Area Center Up Title: \"ESG PRACTICES\" on Sustainability Page\r\n    Then should see Our Traum Area Center Up Description: \"Traum Kaffee is adopting ESG practices to minimize negative environmental impacts, maintain high social standards, and ensure transparent governance practices.\" on Sustainability Page\r\n    Then should see Our Traum Area Right Up Image on Sustainability Page\r\n    Then should see Our Traum Area Right Up Title: \"ECO-FRIENDLY PACKAGING\" on Sustainability Page\r\n    Then should see Our Traum Area Right Up Description: \"We are proud to use 100% compostable packaging. Every single component of the Traum package you receive can become soil through composting.\" on Sustainability Page\r\n    Then should see Our Traum Area Right Down Image on Sustainability Page\r\n    Then should see Our Traum Area Right Down Title: \"CLIMATE ACTION\" on Sustainability Page\r\n    Then should see Our Traum Area Right Down Description: \"We're dedicated to reducing our environmental impact. We prioritize sustainable practices from start to finish to promote a healthier planet.\" on Sustainability Page\r\n    Then should see Traum Sustainability Value Area Title: \"Traum Sustainability Values\" on Sustainability Page\r\n    Then should see Traum Sustainability Value Area Description: \"We care about people. We work closely with our coffee farmers to ensure that they are paid fairly and have safe and healthy working conditions.\" on Sustainability Page\r\n    Then should see Traum Sustainability Value Area Image on Sustainability Page","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Ronwell/Desktop/TraumKaffee2/src/test/resources/features/SustainabilityPage.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Sustai hods.\" on Sustainability Page"},{"astNodeIds":["23d4d5c7-ffcc-4381-83f0-ef3da5cc7d3b"],"id":"6ad36f39-c03d-4542-93c3-90cb8496c8ab","type":"Outcome","text":"should see Our Traum Area Center Up Image on Sustainability Page"},{"astNodeIds":["7f3cde14-ab7a-4ecc-a9b4-23eb5dbf2cb7"],"id":"0694eabb-9c2f-4d7b-aa1f-3b176f5021ee","type":"Outcome","text":"should see Our Traum Area Center Up Title: \"ESG PRACTICES\" on Sustainability Page"},{"astNodeIds":["a92d3231-7a32-498b-b8ae-a78f178739d7"],"id":"6dfba8e0-b9c5-434c-935a-6dcce9df9305","type":"Outcome","text":"should see Our Traum Area Center Up Description: \"Traum Kaffee is adopting ESG practices to minimize negative environmental impacts, maintain high social standards, and ensure transparent governance practices.\" on Sustainability Page"},{"astNodeIds":["9fcc2220-7afd-4f8c-ac0d-37e342d6e8c2"],"id":"0df7fc45-eb79-406f-a349-7c7e167dbaab","type":"Outcome","text":"should see Our Traum Area Right Up Image on Sustainability Page"},{"astNodeIds":["26d4c55b-81e3-47b4-b223-b12e3e606c66"],"id":"78a6a718-6cea-413d-80b1-747bdfd2b0ff","type":"Outcome","text":"should see Our Traum Area Right Up Title: \"ECO-FRIENDLY PACKAGING\" on Sustainability Page"},{"astNodeIds":["1f1f5156-7ab0-4322-8503-b9d4d97a834f"],"id":"dd8eabde-6755-4eb5-b064-70bd99e0c635","type":"Outcome","text":"should see Our Traum Area Right Up Description: \"We are proud to use 100% compostable packaging. Every single component of the Traum package you receive can become soil through composting.\" on Sustainability Page"},{"astNodeIds":["06475be7-ffa2-4a5d-9285-66b4d98cf11b"],"id":"98861056-c95e-4a32-8c88-7880f4988548","type":"Outcome","text":"should see Our Traum Area Right Down Image on Sustainability Page"},{"astNodeIds":["3085e1f3-9e92-4db5-b9d8-696c55e6ec79"],"id":"9859339b-bbe0-4337-bd22-6e9d40bf352d","type":"Outcome","text":"should see Our Traum Area Right Down Title: \"CLIMATE ACTION\" on Sustainability Page"},{"astNodeIds":["671a39fd-a800-4b57-b90d-8979b1f607e9"],"id":"9fcd02b4-7203-41a1-bac0-c5620b7f3e54","type":"Outcome","text":"should see Our Traum Area Right Down Description: \"We're dedicated to reducing our environmental impact. We prioritize sustainable practices from start to finish to promote a healthier planet.\" on Sustainability Page"},{"astNodeIds":["db71f761-06cc-4c7e-80b7-1aadad348dbe"],"id":"d4ec8527-84c8-41ff-9e41-987c4a21717c","type":"Outcome","text":"should see Traum Sustainability Value Area Title: \"Traum Sustainability Values\" on Sustainability Page"},{"astNodeIds":["2bea5d65-f2d8-48a3-9f2e-732baa98ac61"],"id":"5197735e-7bd5-4d3e-a05b-93bcfc9c2e7a","type":"Outcome","text":"should see Traum Sustainability Value Area Description: \"We care about people. We work closely with our coffee farmers to ensure that they are paid fairly and have safe and healthy working conditions.\" on Sustainability Page"},{"astNodeIds":["1ad003e6-36a9-4b7e-8c50-d8840a25bde4"],"id":"63b34b96-1f10-4c3d-a51e-2ecccd3ab2f8","type":"Outcome","text":"should see Traum Sustainability Value Area Image on Sustainability Page"}],"tags":[{"name":"@SustainabilityPage","astNodeId":"f2fd4e3b-e9d4-4f27-92c6-ab6714c92c81"},{"name":"@TextAndComponent","astNodeId":"b2878117-2376-4f5c-bfe0-34554027dc7d"}],"astNodeIds":["271a3283-375b-4e9b-842a-9d7153ad9892"]}},{"source":{"uri":"file:///C:/Users/Ronwell/Desktop/TraumKaffee2/src/test/resources/features/TrainingPage.feature","data":"@TrainingPage\r\nFeature: Training Page\r\n\r\n  @TrainingArea @TextAndComponent\r\n  Scenario: Training Area Text and Component Control\r\n    Given user on the Training Page\r\n    Then should see Training Area Title: \"Training\" on Training Page\r\n    Then should see Training Area Description: \"At Traum, we believe that making the perfect cup of coffee is an art form that requires not only skill but also knowledge and passion.\" on Training Page\r\n    Then should see Training Area Image on Training Page\r\n    Then should see Description Area Description: \"Our training program is designed to help you and your staff develop the skills and knowledge you need to create high-quality coffee drinks and provide an exceptional coffee experience for your customers.At Traum Kaffee, our goal is not only to help you make the perfect cup of coffee but also to share our knowledge and passion for coffee with you. We believe that by understanding the coffee-making process from start to finish, you can appreciate the art and science behind this beloved beverage and ultimately serve your customers the best possible coffee experience.\" on Training Page\r\n    Then should see Coffee Training Area Title: \"Coffee Training\" on Training Page\r\n    Then should see Coffee Training Area Description: \"Our coffee education program goes beyond just teaching you how to brew coffee. We also take the time to educate you on the origins of coffee, the factors that impact the quality and flavor of coffee, and how we select our coffee beans through a process called cupping. This helps you make informed decisions when it comes to selecting and brewing coffee and allows you to appreciate the art and science behind this beloved beverage.In addition, we are passionate about the roasting process and take great care in roasting our coffee beans to perfection. We would be delighted to share our roasting process with you and show you how we carefully roast our coffees to bring out their unique and delicious flavors.\" on Training Page\r\n    Then should see Coffee Training Area Image on Training Page\r\n    Then should see Machine Training Area Title: \"Machine Training\" on Training Page\r\n    Then should see Machine Training Area Description: \"Our machine training program is designed to teach you and your staff how to operate and maintain your coffee equipment to ensure that it operates at peak performance.We cover everything from routine cleaning and maintenance to troubleshooting common issues that may arise. With our machine training, you can ensure that your equipment is always in top condition, allowing you to serve high-quality coffee to your customers consistently.\" on Training Page\r\n    Then should see Machine Training Area Image on Training Page\r\n    Then should see Barista Training Area Title: \"Barista Training\" on Training Page\r\n    Then should see Barista Training Area Description: \"Our barista training program is a comprehensive and hands-on learning experience that will teach you and your staff everything you need to know to become skilled coffee professionals. We start by teaching the fundamentals of espresso extraction, including grind size, dose, and tamping pressure. Once you have a solid foundation in espresso preparation, we move on to milk steaming and texturing techniques. You'll learn how to create the silky microfoam that's essential for latte art and how to pour beautiful designs like hearts, rosettas, and tulips.But our training program isn't just about technique. We also cover the science behind coffee extraction and milk chemistry, helping you understand how different variables can affect the taste of your drinks. We'll also teach you how to troubleshoot common issues, so you can ensure that your drinks are always perfect.\" on Training Page\r\n    Then should see Barista Training Area Image on Training Page\r\n    Then should see Workshops Area Title: \"Workshops\" on Training Page\r\n    Then should see Workshops Area Description: \"We offer various workshops covering various topics, including advanced latte art, coffee cupping, and coffee brewing techniques. Our workshops are designed to be interactive!Contact us to learn more about our workshop offerings and how we can help you take your coffee game to the next level.\" on Training Page\r\n    Then should see Workshops Area Image on Training Page\r\n    Then should see Lets Grab a Coffee Area Title: \"Let's Grab a Coffee!\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Description: \"For more information on how to partner with us and to learn more about our wholesale coffee program,contact us now!\" on Whosale Page\r\n    Then should see Lets Grab a Coffee Area Full Name: \"Full Name\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Email: \"Email\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Contact Number: \"Contact Number\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Business Name: \"Business Name\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Type of Business: \"Type of Business\" on Training Page\r\n    When click Lets Grab a Coffee Area Type of Busines on Whosale Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Hotel\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Restaurant\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Cafe\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Office\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Events\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Type of Business Option: \"Other\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Tell us: \"Tell us a bit about your business... the more info the better!\" on Training Page\r\n    Then should see Lets Grab a Coffee Area Send Button: \"SEND\" on Training Page\r\n\r\n  @LetsGrabaCoffeeArea @Successfully\r\n  Scenario Outline: Lets Grab a Coffee Area Successfully Send Control\r\n    Given user on the Training Page\r\n    When sendkeys Lets Grab a Coffee Area Full Name: \"<fullName>\" on Training Page\r\n    When sendkeys Lets Grab a Coffee Area Mail: \"<mail>\" on Training Page\r\n    When sendkeys Lets Grab a Coffee Area Contact Number: \"<contactNumber>\" on Training Page\r\n    When sendkeys Lets Grab a Coffee Area Business Name: \"<businessName>\" on Training Page\r\n rol","language":"en","steps":[{"astNodeIds":["eab5b7d3-f9f6-4bb4-a582-47fb65ec48e5"],"id":"1fc7ab80-47f9-47c3-97e9-c2b398a2f4df","type":"Context","text":"user on the Training Page"},{"astNodeIds":["f47800db-0924-49e3-9a67-aa383ca178f8"],"id":"b90e3b35-eed9-45a7-a00d-c2436c5f61b1","type":"Outcome","text":"should see Training Area Title: \"Training\" on Training Page"},{"astNodeIds":["cf6eac47-6b1e-4b22-b3b1-a47d71322937"],"id":"6853d4ce-0202-459f-99a9-3ce71d77b732","type":"Outcome","text":"should see Training Area Description: \"At Traum, we believe that making the perfect cup of coffee is an art form that requires not only skill but also knowledge and passion.\" on Training Page"},{"astNodeIds":["f8635b5d-cf2e-4e2b-99d3-44c1e7aec6d8"],"id":"a0ebd661-17df-4009-b409-f7c5ef4a021b","type":"Outcome","text":"should see Training Area Image on Training Page"},{"astNodeIds":["e83ea61f-7324-4381-b206-8e3c0e14a85a"],"id":"6c21a7d4-6728-4c4f-94d6-d07c64233651","type":"Outcome","text":"should see Description Area Description: \"Our training program is designed to help you and your staff develop the skills and knowledge you need to create high-quality coffee drinks and provide an exceptional coffee experience for your customers.At Traum Kaffee, our goal is not only to help you make the perfect cup of coffee but also to share our knowledge and passion for coffee with you. We believe that by understanding the coffee-making process from start to finish, you can appreciate the art and science behind this beloved beverage and ultimately serve your customers the best possible coffee experience.\" on Training Page"},{"astNodeIds":["5faaf0f1-d105-42b2-ba9f-0f5171c07c93"],"id":"33c861e9-be99-4256-9157-ad263900d3c0","type":"Outcome","text":"should see Coffee Training Area Title: \"Coffee Training\" on Training Page"},{"astNodeIds":["2297f941-ba5a-4556-9336-537c82355c44"],"id":"494e8299-185c-4278-845e-a6f3454391fd","type":"Outcome","text":"should see Coffee Training Area Description: \"Our coffee education program goes beyond just teaching you how to brew coffee. We also take the time to educate you on the origins of coffee, the factors that impact the quality and flavor of coffee, and how we select our coffee beans through a process called cupping. This helps you make informed decisions when it comes to selecting and brewing coffee and allows you to appreciate the art and science behind this beloved beverage.In addition, we are passionate about the roasting process and take great care in roasting our coffee beans to perfection. We would be delighted to share our roasting process with you and show you how we carefully roast our coffees to bring out their unique and delicious flavors.\" on Training Page"},{"astNodeIds":["ab8dcb9d-466f-4cdf-95ca-10213c508ee4"],"id":"30f1d26f-ea49-4240-beb8-a61ca7e022b0","type":"Outcome","text":"should see Coffee Training Area Image on Training Page"},{"astNodeIds":["1edfbec2-99be-4436-9606-d133316916a4"],"id":"4b629387-c9d7-409d-bc15-0755f122bfee","type":"Outcome","text":"should see Machine Training Area Title: \"Machine Training\" on Training Page"},{"astNodeIds":["5a591da2-5f7b-4fcf-83df-070f3b949c02"],"id":"5afd5528-6c23-4d12-b329-e91312853ed2","type":"Outcome","text":"should see Machine Training Area Description: \"Our machine training program is designed to teach you and your staff how to operate and maintain your coffee equipment to ensure that it operates at peak performance.We cover everything from routine cleaning and maintenance to troubleshooting common issues that may arise. With our machine training, you can ensure that your equipment is always in top condition, allowing you to serve high-quality coffee to your customers consistently.\" on Training Page"},{"astNodeIds":["23fb8e61-ce33-46aa-9a42-b5cd802f105b"],"id":"cc496e2e-1c06-4788-915e-a25dfa7a5ece","type":"Outcome","text":"should see Machine Training Area Image on Training Page"},{"astNodeIds":["e51fcb3c-f1ac-4b94-9cc3-9be47652180b"],"id":"12d4cecd-4725-4b80-9832-9dbb9fbe61c9","type":"Outcome","text":"should see Barista Training Area Title: \"Barista Training\" on Training Page"},{"astNodeIds":["5bdd6901-1364-4553-832d-6d80a2da30b8"],"id":"fe6202af-eb82-45d9-9b0b-0f6bfef30dbe","type":"Outcome","text":"should see Barista Training Area Description: \"Our barista training program is a comprehensive and hands-on learning experience that will teach you and your staff everything you need to know to become skilled coffee professionals. We start by teaching the fundamentals of espresso extraction, including grind size, dose, and tamping pressure. Once you have a solid foundation in espresso preparation, we move on to milk steaming and texturing techniques. You'll learn how to create the silky microfoam that's essential for latte art and how to pour beautiful designs like hearts, rosettas, and tulips.But our training program isn't just about technique. We also cover the science behind coffee extraction and milk chemistry, helping you understand how different variables can affect the taste of your drinks. We'll also teach you how to troubleshoot common issues, so you can ensure that your drinks are always perfect.\" on Training Page"},{"astNodeIds":["2c1e8f8b-078c-48e1-be32-50d7e234c1e0"],"id":"354717ae-10b3-4fd5-b1b9-5cdcd08e7e5a","type":"Outcome","text":"should see Barista Training Area Image on Training Page"},{"astNodeIds":["166c28a3-38ed-4641-8873-c4a24dc50fda"],"id":"2cd895ab-2dbe-4d4c-89eb-f161d3a3ba4e","type":"Outcome","text":"should see Workshops Area Title: \"Workshops\" on Training Page"},{"astNodeIds":["d63af523-6af3-4416-bce7-bb6c67e58df8"],"id":"3fcc01cb-6e42-4b50-988f-0524be36868c","type":"Outcome","text":"should see Workshops Area Description: \"We offer various workshops covering various topics, including advanced latte art, coffee cupping, and coffee brewing techniques. Our workshops are designed to be interactive!Contact us to learn more about our workshop offerings and how we can help you take your coffe
